	$origen_nombre='';

	if ($origen_row['tipo_origen']== 1){
		$sql_persona = "SELECT * FROM tbl_member WHERE id =". $origen_row['personaid_origen'];
		$persona_row = $db->fcGetSQL($sql_persona,1,2);
		$origen_nombre = $persona_row['name'];
	}
	else{
		$sql_sector = "SELECT * FROM adma_sector where  sectorid =".$origen_row['sectorid_origen'];
		$sector_row = $db->fcGetSQL($sql_sector,1,2);
		$origen_nombre = $sector_row['sectords'];
	}
    
	$sql_destino = "SELECT * FROM adrg_borrador_i1 WHERE baja = 0 and  borradorid=".$borradorid;
	$destino_row = $db->fcGetSQL($sql_destino,1,2);
	$destino_nombre ='';

	if ($destino_row['tipodestinoid']==1){
		$sql_persona = "SELECT * FROM tbl_member WHERE id =". $destino_row['personaid_destino'];
		$persona_row = $db->fcGetSQL($sql_persona,1,2);
		$destino_nombre = $persona_row['name'];
	}
	else{
		$sql_sector = "SELECT * FROM adma_sector where  sectorid =".$destino_row['sectorid_destino'];
		$sector_row = $db->fcGetSQL($sql_sector,1,2);
		$destino_nombre = $sector_row['sectords'];
	}

